VALUES ('3245412158995', 'Coquilles aux crevettes', 'Mayonnaise 27% (huile de colza, moutarde de Dijon [eau, graine de moutarde, vinaigre, sel, antioxydant : disulfite de potassium, acidifiant : acide citrique], jaune dloeufs, vinaigre, sel, sucre, amidon modifié de pomme de terre, épaississants : gomme de guar et gomme de xanthane, arôme), carottes, crevettes nordiques décortiquées cuites 16% (crevettes nordiques 14%, eau, sel), petits pois, navets, haricots verts, tomate, concombre, conservateurs : lactate de sodium et sorbate de potassium, double concentré de tomates, cognac modifié (cognac, sel, arôme naturel de poivre), amidon modifié de pomme de terre, acidifiants : acide citrique et acide tartrique, poivre blanc, sel, épaississant : gomme de xanthane, dextrose, arômes naturels, piment de cayenne. La jardinière dans ce produit représente 49% de la recette. Pourcentages exprimés sur l\'ensemble du produit. Peut contenir des traces de gluten, poissons, soja, lait, fruits à coque, céleri, graines de sésame, lupin et mollusques. Les tomates proviennent de France, d\'Espagne et du Maroc, les autres légumes proviennent de l\'Union Européenne. La mayonnaise est transformée en France. Les crevettes sont transformees en Norvège. Fibres Valeurs énergétique et Energie (kJ) Energie (kcal) Matières grasses (g) dont saturés(g) Glucides (g) dont sucres(g) alimentaires Protéines (g) Sel (g) nutritionnelles mo ennes our', '20', '1.6', '3.4', '1.7', '2.5', '4.2', '0.88', '0.346456692913386', '', '1');

