INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3245412160059', 'Vacherin vanille framboise, gourmand et fruite', 'Crème glacée à la vanille 42% : Eau, lait écrémé reconstitüé, crème 19%* sirop de glucose-fructose, sucre, lactose et protéines de lait, sirop de glucose, arôme naturel de vanille, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar, colorants : rocou et curcumine.*Pourcentage exprimé sur la crème glacée à la vanille. Sorbet à la framboise 42% : Eau, purée de framboise 30%* sucre, sirop de glucose-fructose, arôme naturel de framboise, émulsifiants : mono- et diglycérides d\'acides gras et esters lactiques des mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - pectines - gomme xanthane - gomme guar, jus concentré de sureau, acidifiant : acide citrique, colorant : rouge de betterave, protéines de pois hydrolysées : protéines de pois et sucre. *Pourcentage exprimé sur le sorbet à la framboise. Meringue 12% : Sucre, blanc d\'?ufs. Préparation de morceaux de framboise 3,5% : Morceaux de framboise 58%*, sucre, sirop de glucose-fructose, eau, épaississant : phosphate de diamidon hydroxypropylé, gélifiants : gomme xanthane et carraghénanes, arôme naturel, correcteur d\'acidité : citrates de potassium, jus de fruits rouges à base de concentré (sureau et aronia). *Pourcentage exprimé sur la préparation de morceaux de framboise. Décor 0,5% : Framboise entière. Peut contenir des traces de soja, de gluten, d\'arachide et de fruits à coque. @Vanilleroomijs en frambozensorbet met meringue en een bereiding van stukjes framboos en hele frambozen, diepgevroren. Ingrediënten: Vanilleroomijs 42% : Water, gereconstitueerde magere melk, room 19%*, glucose-fructosestroop, suiker, lactose en melkeiwitten, glucosestroop, natuurlijk vanillearoma, emulgator : mono- en diglyceriden van vetzuren, geleermiddelen : johannesbroodpitmeel en guarpitmeel, kleurstoffen : annatto en curcumine. *Percentage uitgedrukt op het vanilleroomijs. Frambozensorbet 42% : Water, frambozenpuree 30%*, suiker, glucose-fructosestroop, natuurtijk frambozenaroma, emulgatoren : mono- en diglyceriden van vetzuren en mono- en diglyceriden van vetzuren veresterd met melkzuur, geleermiddeien : johannesbroodpitmeel - pectinen - xanthaangom - guarpitmeel, geconcentreerd vlierbessensap, voedingszuur : citroenzuur, kleurstof : bietenrood, gehydrolyseerde erwteneiwitten : erwteneiwitten en suiker. *Percentage uitgedrukt op de frambozensorbet. Meringue 12% : Suiker, kippenei-ejwit. Bereiding van stukjes framboos 3,5% : Stukjes framboos 58%*, suiker, glucose-fructosestroop, water, verdikkingsmiddel : hydroxypropyldizetmeelfosfaat, geleermiddelen : xanthaangom en carrageen, natuurlijk aroma, zuurteregelaar : kaliumcitraten, sap van rode vruchten uit sapconcentraat (vlierbes en appelbes). *Percentage uitgedrukt op de bereiding van stukjes framboos. Versiering 0,5% : Hele framboos. Kan sporen bevatten van soja, gluten, aardnoten en noten.', '3.8', '2.5', '34', '29', '0.6', '1.5', '0.09', '0.0354330708661417', '', '0');

